import React from 'react'

const Country = ({ country }) => {
    console.log(country)
    return (
        <>
            <h1>{country.name}</h1>
            <br/>
            <p>Capital: {country.capital}</p>
            <p>Population: </p>
        </>
    )
}

export default Country
